import React from "react";


class Navbar extends React.Component{
    render(){

        return(
            <div className="nav">
                <div className="search-container">
                <input onChange={this.handleChange}></input>
                <button id="search-btn">search</button>
                </div>
            </div>
        )


    }
    
    
    

}






export default Navbar;
